import Header from './Header';
import TransitDetail from './TransitDetail';

function Container() {    
 
    return (
        <div >
            <div>
                <Header/>
            </div>           
            <div>
                <TransitDetail/>
            </div>            
        </div>       
    );
}

export default Container;
